import React, {Component} from 'react';
import {Menu} from "antd";

import navStyle from './index.module.css';

const {SubMenu}=Menu;

class Nav extends Component {
    render() {
        return (
            <div className={navStyle.frame}>
                <Menu theme='dark'>
                    <SubMenu key='approve' title='企业管理'>
                        <Menu.Item key='sign'>企业注册</Menu.Item>
                        <Menu.Item key='sign'>企业变更</Menu.Item>
                    </SubMenu>
                </Menu>
            </div>
        );
    }
}

export default Nav;
